import React from 'react';

interface Props {
  favourites: string[];
}

const FavouriteList: React.FC<Props> = ({ favourites }) => {
  return (
    <div>
      <ul>
        {favourites.map((favourite, index) => (
          <li key={index}>{favourite}</li>
        ))}
      </ul>
    </div>
  );
};

export default FavouriteList;
